import { useEffect, useState } from "react";
import { useSelector } from "react-redux/es/exports";
import ViewProduct from "./ViewProduct";
export default function SingleProduct(){
    let productId = useSelector(state => state.fetchedid);
    const [initialDataProd, setDataProd] = useState([]);

    useEffect(() => {
        fetch(`https://fakestoreapi.com/products/${productId}`)
        .then((res) => res.json())
        .then((data) => setDataProd(data));
    }, []);
    return(
        <>
        <ViewProduct data={initialDataProd}/> 
        {console.log(`https://fakestoreapi.com/products/${productId}`)} 
        </>    
    );
    
}
